 "html": "<div style=\"text-align:left; color:#000; \"><DIV STYLE=\"text-align:center;\"><SPAN STYLE=\"letter-spacing:0px;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"font-size:26px;font-family:'Vivaldi';\"><B>Beluk Jampuk</B></SPAN></SPAN></DIV><DIV STYLE=\"text-align:center;\"><SPAN STYLE=\"letter-spacing:0px;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"font-size:14px;font-family:'Times New Roman', Times, serif;\"><B><I>Bubo Sumartanus</I></B></SPAN></SPAN></DIV><p STYLE=\"margin:0; line-height:14px;\"><BR STYLE=\"letter-spacing:0px;color:#000000;font-size:12px;font-family:Arial, Helvetica, sans-serif;\"/></p><DIV STYLE=\"text-align:justify;\"><SPAN STYLE=\"letter-spacing:0px;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"font-size:14px;font-family:'Times New Roman', Times, serif;\">Beluk Jampuk termasuk jenis burung hantu berukuran sedang atau besar dengan panjang tubuh sekitar 60 sampai 66 cm dan berat tubuh beluk jampuk sekitar 620 gram, memiliki bulu berwarna abu-abu tua dengan berkas telinga horizontal mencolok, tubuh bagian atas berwarna coklat kehitaman, seluruhnya bergaris kuning tua halus, dan memiliki alis berwarna hitam.</SPAN></SPAN></DIV></div>",
