 "html": "<div style=\"text-align:left; color:#000; \"><DIV STYLE=\"text-align:center;\"><SPAN STYLE=\"letter-spacing:0px;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"font-size:26px;font-family:'Vivaldi';\"><B>Rusa Timor</B></SPAN></SPAN></DIV><DIV STYLE=\"text-align:center;\"><SPAN STYLE=\"letter-spacing:0px;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"font-size:14px;font-family:'Times New Roman', Times, serif;\"><B><I>Ceruus Timorensis</I></B></SPAN></SPAN></DIV><p STYLE=\"margin:0; line-height:14px;\"><BR STYLE=\"letter-spacing:0px;color:#000000;font-size:12px;font-family:Arial, Helvetica, sans-serif;\"/></p><DIV STYLE=\"text-align:justify;\"><SPAN STYLE=\"letter-spacing:0px;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"font-size:14px;font-family:'Times New Roman', Times, serif;\"><B>Ciri-ciri : </B></SPAN><SPAN STYLE=\"font-size:14px;font-family:'Times New Roman', Times, serif;\">Rusa timor memiliki ukuran tubuh yang kecil, dahi cekung, tungkai pendek, gigi seri relatif besar, ekor panjang, serta bulu atau rambut berwarna coklat ke kuning kuningan.</SPAN></SPAN></DIV><p STYLE=\"margin:0; line-height:14px;\"><BR STYLE=\"letter-spacing:0px;color:#000000;font-size:12px;font-family:Arial, Helvetica, sans-serif;\"/></p><DIV STYLE=\"text-align:justify;\"><SPAN STYLE=\"letter-spacing:0px;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"font-size:14px;font-family:'Times New Roman', Times, serif;\"><B>Makanan : </B></SPAN><SPAN STYLE=\"font-size:14px;font-family:'Times New Roman', Times, serif;\">Rumput Australia (paspalum dilatatum), Waru, Rumput Gajah, Rumput teki, Alang alang, dan Awar-awar.</SPAN></SPAN></DIV><p STYLE=\"margin:0; line-height:14px;\"><BR STYLE=\"letter-spacing:0px;color:#000000;font-size:12px;font-family:Arial, Helvetica, sans-serif;\"/></p><DIV STYLE=\"text-align:justify;\"><SPAN STYLE=\"letter-spacing:0px;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"font-size:14px;font-family:'Times New Roman', Times, serif;\"><B>Habitat : </B></SPAN><SPAN STYLE=\"font-size:14px;font-family:'Times New Roman', Times, serif;\">Hutan Mangrove, hutan pantai, dan padang rumput. Sedangkan untuk persebaran alaminya terdapat di Pulau Jawa, sulawesi, maluku, dan Nusa tenggara.</SPAN></SPAN></DIV></div>",
